var tipuesearch = {"pages":[{"tags":"bg8","text":"啟動 cdw18 協同專案 CDW11: 繪出不同順序的英文字母排序。 AAAA: ABCD: BADC: CDW13: 複製在kmolab上的程式碼，並改畫出垂直鏈條。 CDW14: 複製在kmolab上的程式碼，並製作第四個齒輪，而且需要跟第其他三個齒輪嚙合 CDW 18: 製作期末報告並使用ONSHAPE模擬四齒輪嚙合。 心得: 做出齒輪是很簡單的，因為onshape可以直接叫出來，不過連接齒輪的同學就比較辛苦了，非常感謝他~ 自評:70","title":"40323242 cdw18 期末報告","url":"./40323242-cdw18-qi-mo-bao-gao.html"},{"tags":"bg8","text":"啟動 cdw13 協同專案 CDW13: 複製在kmolab上的程式碼，並改畫出垂直鏈條。 心得: 只要慢慢調整鍊條位置並轉90度，練習熟練的話，後面再做就相較迅速許多了，跟之前作業比起來有一點變化。 自評: 70","title":"40323242 cdw13 報告","url":"./40323242-cdw13-bao-gao.html"},{"tags":"bg8","text":"啟動 cdw14 協同專案 CDW14: 複製在kmolab上的程式碼，並製作第四個齒輪，而且需要跟第其他三個齒輪嚙合 心得: 雖說是複製改東西，不過要更改的東西也 自評: 65","title":"40323242 cdw14 報告","url":"./40323242-cdw14-bao-gao.html"},{"tags":"bg8","text":"啟動 cdw11 協同專案 CDW11: 繪出不同順序的英文字母排序。 AAAA: ABCD: BADC: 心得: 這次的作業跟之前比起來相較簡單許多，只要畫畫圖即可，也謝謝大家的幫忙。 自評: 60","title":"40323242 cdw11 報告","url":"./40323242-cdw11-bao-gao.html"},{"tags":"bg8","text":"cdw11內容: 複製老師的程式，試著做出不同的排列。 AAAA: openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/a4 DBAC: openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/DBAC ABCD: openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/ABCD cdw13內容: 複製在kmolab上的程式碼，畫出垂直鏈條。 openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/oo openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/oo2 cdw14內容: 複製老師程式碼，嘗試製作第四個齒輪，而且需要跟第三個齒輪嚙合，再用OnShape來模擬。 openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213_1/oooo onshape: https://cad.onshape.com/documents/f908b506442648865f0e8e43/w/d9c7a46af754ae67350bc846/e/e49c75f482fb3fa29f096d79 心得:經過期中之後，換了cdw11感覺又變難了，而且這次又是要用程式畫圖，onshape的圖，這次比較簡單了，但是要注意齒輪鎳合旋轉時的設定， 旋轉角在製作齒輪時可以不用設，全部是0就可以了，這設定令我卡了很久，程式畫圖方面，參考了同學的程式自己又做了一次，而且在同學的幫忙下，終於完成。 自評:70分","title":"40323213 期末報告","url":"./40323213-qi-mo-bao-gao.html"},{"tags":"bg8","text":"cdw11內容: 複製老師的程式，試著做出不同的排列。 AAAA: openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/a4 DBAC: openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/DBAC ABCD: openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/ABCD 心得:字母的排列讓我花了不少時間，加上自己近端試很多次造成還當機，不過後來還是完成了，程式需要很多的時間去理解。 自評:70分","title":"40323213 cdw11 報告","url":"./40323213-cdw11-bao-gao.html"},{"tags":"bg8","text":"cdw13內容: 複製在kmolab上的程式碼，畫出垂直鏈條。 openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/oo openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213/oo2 心得:這次的進度跟w11有點相似所以做起來比較輕鬆，而且可以複製老師的程式，覺得好玩。 自評:70分","title":"40323213 cdw13 報告","url":"./40323213-cdw13-bao-gao.html"},{"tags":"bg8","text":"cdw14內容: 複製老師程式碼，嘗試製作第四個齒輪，而且需要跟第三個齒輪嚙合，再用OnShape來模擬。 openshift:http://cdw11-40323200.rhcloud.com/bg8_40323213_1/oooo 心得:要算齒輪的數據很麻煩，onshape在做的時候其實可以不用設定旋轉角(在組合時設定就好)，這地方讓我做了很久，齒輪會一直卡住。 自評:70分","title":"40323213 cdw14 報告","url":"./40323213-cdw14-bao-gao.html"},{"tags":"ag100","text":"為了能夠更客觀進行各組與各學員的期末自評, 特別以組為單位, 各組員為內容建構成員, 利用四堂課程的時間, 在各組新建的 Github 倉儲中完成此一專案報告. 基本專案建置流程: 請各組推派代表, 在其 Github 帳號下, 建立一個分組期末專案倉儲, 倉儲名稱定為 2016springcd_aG1, 其中的 aG1 代表 a 班的第 1 組 (以下將以 2016springcd_xGx 代表各組建立的倉儲名稱), 請各組自行配合改為各自的組別代號, 而且請各組特別注意, 此一倉儲的建立時間, 必須是在各班期末考週的第1堂課程時間之後建立, 才納入計分. 倉儲建立之後的第1階段提交推送資料, 必須是修改 README.md, 而且必須透過協調, 由各組員依序 git clone 各組在代表組員帳號下所建立的 2016springcd_xGx 倉儲後, 分別由各組員自行用學號登錄的 github 帳號以協同提交推送的過程, 各自修改 README.md 檔案, 將自己的學號與個人對應的 Github Page 網頁, 放入 REAEME.md 檔案中. 第2項的評分依據為各組員必須自行用自己在 Github 登錄的帳號, 取得各組的 2016springcd_xGx 倉儲協同權限後, 再進行 RADEME.md 的協同修改, 之後各組員完成提交推送的紀錄, 必須可以在 commits 呈現各自的學號與提交推送內容及時間, 才納入計分. 各組以協同流程完成 README.md 的編修後, 接著請取用 https://github.com/2015fallhw/2016springcd_final 倉儲中的架構, 在各組的代表成員的 2016springcd_xGx 倉儲中運作, 並設法將其中的 pelican 網誌內容, 呈現在 2016springcd_xGx 倉儲的 gh-pages 分支中, 完成後, 請各組員在此一 gh-pages 倉儲中各自建立一個能夠呈現自我期末報告的網誌, 並且將此一在 2016springcd_xGx 倉儲的 gh-pages 分支中的連結, 放入 2016springcd_xGx 倉儲 master 分支的 README.md 最前方. 接著, 請利用協同產品設計實習課程所學到的 2D 網際繪圖內容, 以分組組員各自繪製一簡單幾何零件圖形的方式, 將 2016springcd_xGx 倉儲資料中的 wsgi 程式, 送到各組代表成員的 OpenShift 網站中呈現, 並將 2D 繪圖程式連結, 放到 2016springcd_xGx 倉儲 master 分支的 README.md 資料中, 並且放在分組 gh-pages 連結之後. 最後, 請各組以協同方式在 Onshape 雲端電腦輔助設計軟體中, 建立一個名稱為 2016springcd_xGx 的公開協同 Document, 然後將各組組員納入作為可以 edit 與 view 的協同者, 以每一位組員利用 Onshape 官方所釋出的 SG (正齒輪) FeatureScript, 分別依照學號排序, 從齒數 17 開始, 以每位學員遞增 2 齒的方式, 各自在 Part Studio 建立一個正齒輪零件, 並以學號命名零件後, 完成後, 以最簡單的方式在以組別 xGx 命名的組立件中完成囓合組立 (例如, 該組有 6 位成員, 則各自提供一個正齒輪零件, 齒數分別為 17, 19, 21, 23, 25, 27 等, 最後則完成6個齒輪的囓合組立), 完成後, 請將各組的囓合正齒輪組立件以 share 功能, 設定成網路公開組立件, 並將此一 Onshape 的組立件連結, 放到 2016springcd_xGx 倉儲 master 分支的 README.md 資料中, 放在分組 wsgi 2D 繪圖連結之後. 最最後, 請各組依序完成上述工作任務後, 將各組與各學員所完成的網站連結放入 https://github.com/2015fallhw/cdw11/wiki 各組員的對應資料區中, 以作為期末成績評分參考. 祝大家 2016 Summer 假期愉快!","title":"協同產品設計實習期末考週專案報告","url":"./xie-tong-chan-pin-she-ji-shi-xi-qi-mo-kao-zhou-zhuan-an-bao-gao.html"}]};